package com.my.leetcode.word_abbreviation;

import java.util.*;

public class Solution {

    public static void main(String[] args) {
        System.out.println(new Solution().wordsAbbreviation(Arrays.asList(
                "like", "god", "internal", "me", "internet", "interval", "intension", "face", "intrusion"
        )));
        //"l2e","god","internal","me","i6t","interval","inte4n","f2e","intr4n"
        long start = System.currentTimeMillis();
        System.out.println(new Solution().wordsAbbreviation(Arrays.asList(
                "","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""
        )));
        System.out.println(System.currentTimeMillis() - start);
    }

    public List<String> wordsAbbreviation(List<String> dict) {
        Map<String, String> abbrToWordMap = new HashMap<>();
        Trie trie = new Trie(dict.toArray(new String[0]), abbrToWordMap);
        Map<String, String> mapRes = trie.traverse(abbrToWordMap);
        List<String> result = new ArrayList<>();
        for (String s : dict) {
            result.add(mapRes.get(s));
        }
        return result;
    }

    private static class Trie {

        public static final char CHAR = 'a';
        private Trie[] map = new Trie[26];
        private Map<String, Integer> abbreviations = new HashMap<>();

        public Trie() {}

        public Trie(String[] words, Map<String, String> abbrToWordMap) {
            for (String word : words) {
                Trie[] aMap = map;
                char[] chars = word.toCharArray();
                StringBuilder prefix = new StringBuilder();
                for (int i = 0; i < chars.length - 1; i++) {
                    int t = chars[i] - CHAR;
                    if (aMap[t] == null) {
                        aMap[t] = new Trie();
                    }
                    prefix.append(chars[i]);
                    String abbr = makeAbbr(prefix.toString(), word);
                    abbrToWordMap.put(abbr, word);
                    aMap[t].abbreviations.put(abbr,
                            aMap[t].abbreviations.getOrDefault(abbr, 0) + 1);
                    aMap = aMap[t].map;
                }
            }
        }

        private String makeAbbr(String prefix, String word) {
            String result = prefix + (word.length() - prefix.length() - 1) + word.charAt(word.length() - 1);
            return result.length() >= word.length()? word: result;
        }

        public Map<String, String> traverse(Map<String, String> abbrToWordMap) {
            Map<String, String> result = new HashMap<>();
            for (Map.Entry<String, Integer> entry : abbreviations.entrySet()) {
                if (entry.getValue() == 1) {
                    result.put(abbrToWordMap.get(entry.getKey()), entry.getKey());
                }
            }
            for (Trie aTrie : map) {
                if (aTrie != null) {
                    aTrie.traverse(abbrToWordMap, result);
                }
            }
            return result;
        }

        private void traverse(Map<String, String> abbrToWordMap, Map<String, String> result) {
            for (Map.Entry<String, Integer> entry : abbreviations.entrySet()) {
                if (entry.getValue() == 1 && !result.containsKey(abbrToWordMap.get(entry.getKey()))) {
                    result.put(abbrToWordMap.get(entry.getKey()), entry.getKey());
                }
            }
            for (Trie aTrie : map) {
                if (aTrie != null) {
                    aTrie.traverse(abbrToWordMap, result);
                }
            }
        }
    }
}
